import React from "react";
import FooterContent from "./FooterLinks";
import { Container, FooterDivider } from "./FooterFragments";

const Footer = () => (
  <Container>
    <FooterContent lowerFooter={false} />
    <FooterDivider />
    <FooterContent lowerFooter={true} />
  </Container>
);

export default Footer;
